import React from "react";

export default (props) => {
    return (
        <div>
            <label for="passoInput"> Passo:</label>
            <input
                id="passoInput"
                type="number"
                value={props.step}
                onChange={(e) => props.OnStepChange(e.target.value)}
            />
        </div>
    );
};
